import React from 'react'
import { useState } from 'react'
const Face = () => {
  const [items,setItems]=useState(
    [
      {
        id:1,
        check:true,
        name:"Reserve the Bus Ticket"
      },
      {
        id:1,
        check:true,
        name:"Reserve the Bus Ticket"
      },
      {
        id:1,
        check:true,
        name:"Reserve the Bus Ticket"
      },
      {
        id:1,
        check:true,
        name:"Reserve the Bus Ticket"
      }
    ]
  )
  return (
    <div>
      <p>To DO List</p>
      <ul>
        {
          items.map((item)=>(
            <li>
              <input
              type="checkbox"
              checked={item.check}/>
            </li>
          ))
        }
      </ul>
    </div>
  )
}

export default Face
